const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`本节介绍如何对 Kubernetes 集群上的 Rancher 安装进行故障排查。`}</p>
    <h2 {...{
      "id": "相关命名空间"
    }}>{`相关命名空间`}</h2>
    <p>{`大多数故障排查都将在这 3 个命名空间中的对象上完成。`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`cattle-system`}</inlineCode>{` - `}<inlineCode parentName="li">{`rancher`}</inlineCode>{` 部署和 Pod。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ingress-nginx`}</inlineCode>{` - Ingress Controller Pod 和 SVC。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`cert-manager`}</inlineCode>{` `}<inlineCode parentName="li">{`cert-manager`}</inlineCode>{` pod。`}</li>
    </ul>
    <h2 {...{
      "id": "default-backend---404"
    }}>{`default backend - 404`}</h2>
    <p>{`导致 Ingress Controller 无法将流量转发到您的 rancher 实例的原因有很多种，但是在大多数情况下，触发这条报错信息的原因是 SSL 配置错误。`}</p>
    <p>{`请检查以下事项，定位问题：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E6%A3%80%E6%9F%A5-rancher-%E6%98%AF%E5%90%A6%E6%AD%A3%E5%9C%A8%E8%BF%90%E8%A1%8C"
        }}>{`Rancher 是否在运行`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E8%AF%81%E4%B9%A6-cn-%E6%98%AF-kubernetes-ingress-controller-fake-certificate"
        }}>{`证书的 CN 是不是为 "Kubernetes Ingress Controller Fake Certificate"`}</a></li>
    </ul>
    <h2 {...{
      "id": "检查-rancher-是否正在运行"
    }}>{`检查 Rancher 是否正在运行`}</h2>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`来检查`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`系统命名空间，并查看 Rancher 容器是否处于 Running 状态。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods

NAME                           READY     STATUS    RESTARTS   AGE
pod/rancher-784d94f59b-vgqzh   1/1       Running   0          10m
`}</code></pre>
    <p>{`如果状态不是`}<inlineCode parentName="p">{`Running`}</inlineCode>{` ，请使用`}<inlineCode parentName="p">{`describe`}</inlineCode>{`命令检查 Pod 事件。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe pod

...
Events:
  Type     Reason                 Age   From                Message
  ----     ------                 ----  ----                -------
  Normal   Scheduled              11m   default-scheduler   Successfully assigned rancher-784d94f59b-vgqzh to localhost
  Normal   SuccessfulMountVolume  11m   kubelet, localhost  MountVolume.SetUp succeeded for volume "rancher-token-dj4mt"
  Normal   Pulling                11m   kubelet, localhost  pulling image "rancher/rancher:v2.0.4"
  Normal   Pulled                 11m   kubelet, localhost  Successfully pulled image "rancher/rancher:v2.0.4"
  Normal   Created                11m   kubelet, localhost  Created container
  Normal   Started                11m   kubelet, localhost  Started container
`}</code></pre>
    <h2 {...{
      "id": "检查-rancher-日志"
    }}>{`检查 Rancher 日志`}</h2>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`找到 Pod。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system get pods

NAME                           READY     STATUS    RESTARTS   AGE
pod/rancher-784d94f59b-vgqzh   1/1       Running   0          10m
`}</code></pre>
    <p>{`使用`}<inlineCode parentName="p">{`kubectl`}</inlineCode>{`和 Pod 名称来查看 Pod 中的日志。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system logs -f rancher-784d94f59b-vgqzh
`}</code></pre>
    <h2 {...{
      "id": "证书-cn-是-kubernetes-ingress-controller-fake-certificate"
    }}>{`证书 CN 是 “Kubernetes Ingress Controller Fake Certificate”`}</h2>
    <p>{`使用浏览器检查证书对的详细信息。如果通用名是“Kubernetes Ingress Controller Fake Certificate”，则说明读取或颁发 SSL 证书时可能出现了问题。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{` 如果您使用的是 LetsEncrypt 颁发的证书，则有时可能需要花些时间来发布证书。`}</p>
    </blockquote>
    <h2 {...{
      "id": "检查-cert-manager-颁发的证书是否存在问题（适用于使用-rancher-自生成证书或-letsencrypt-证书）"
    }}>{`检查 cert-manager 颁发的证书是否存在问题（适用于使用 Rancher 自生成证书或 LetsEncrypt 证书）`}</h2>
    <p><inlineCode parentName="p">{`cert-manager`}</inlineCode>{`有三个部分。`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`cert-manager`}</inlineCode>{` 在`}<inlineCode parentName="li">{`cert-manager`}</inlineCode>{` 命名空间中的 Pod。`}</li>
      <li parentName="ul">{`在`}<inlineCode parentName="li">{`cattle-system`}</inlineCode>{`命名空间中的 `}<inlineCode parentName="li">{`Issuer`}</inlineCode>{` 对象。`}</li>
      <li parentName="ul">{`在`}<inlineCode parentName="li">{`cattle-system`}</inlineCode>{`命名空间中的 `}<inlineCode parentName="li">{`Certificate`}</inlineCode>{` 对象。`}</li>
    </ul>
    <p>{`对每个对象执行`}<inlineCode parentName="p">{`kubectl describe`}</inlineCode>{`并检查事件，来检查可能缺少的内容。`}</p>
    <p>{`首先，检查在`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`命名空间中的 `}<inlineCode parentName="p">{`Certificate`}</inlineCode>{` 对象，如以下代码示例所示，在命令行输入`}<inlineCode parentName="p">{`kubectl -n cattle-system describe certificate`}</inlineCode>{`，会返回`}<inlineCode parentName="p">{`Certificate`}</inlineCode>{`的信息，如事件种类、原因、时间戳、发生事件的根因部件等信息。示例中返回的信息是：根因部件`}<inlineCode parentName="p">{`cert-manager`}</inlineCode>{`在 18 秒前发生了一个 warning 事件，发生的原因是 IssuerNotReady，发送了一条“Issuer rancher not ready”信息。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe certificate
...
Events:
  Type     Reason          Age                 From          Message
  ----     ------          ----                ----          -------
  Warning  IssuerNotReady  18s (x23 over 19m)  cert-manager  Issuer rancher not ready
`}</code></pre>
    <p>{`既然我们知道了发生 warning 的原因是 IssuerNotReady，那么我们需要检查`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`命名空间中的 `}<inlineCode parentName="p">{`Issuer`}</inlineCode>{` 对象，找到触发 IssuerNotReady 警告的原因。如以下代码示例所示，在命令行输入`}<inlineCode parentName="p">{`kubectl -n cattle-system describe issuer`}</inlineCode>{`,会返回`}<inlineCode parentName="p">{`Issuer`}</inlineCode>{`的信息。例中返回的信息是：根因部件`}<inlineCode parentName="p">{`cert-manager`}</inlineCode>{`发生了两个 wanring 事件：`}</p>
    <ul>
      <li parentName="ul">{`19 分钟前发生了一个 warning 事件，而且在事件发生至今的 19 分钟内重复触发了 12 次，发生的原因是 ErrInitIssuer，发送了一条“Error initializing issuer: secret "tls-rancher" not found”信息。触发该事件的原因在信息里面已经描述得非常清楚了，因为找不到"tls-rancher"的密文，所以触发警告信息。`}</li>
      <li parentName="ul">{`9 分钟发生了另一个 wanring 事件，而且在事件发生至今的 19 分钟内重复触发了 16 次，发生的原因是 ErrGetKeyPair，发送了一条“Error getting keypair for CA issuer: secret "tls-rancher" not found”信息。同理，触发这个事件的信息也在信息里面，和上面的原因相同，也是因为找不到"tls-rancher"的密文，才触发了警告信息。`}</li>
    </ul>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe issuer
...
Events:
  Type     Reason         Age                 From          Message
  ----     ------         ----                ----          -------
  Warning  ErrInitIssuer  19m (x12 over 19m)  cert-manager  Error initializing issuer: secret "tls-rancher" not found
  Warning  ErrGetKeyPair  9m (x16 over 19m)   cert-manager  Error getting keypair for CA issuer: secret "tls-rancher" not found
`}</code></pre>
    <p>{`综上所述，触发上述连锁报错的最终原因是缺少"tls-rancher"的密文，可能是密文格式有问题，导致 Rancher 无法读取密文；也可能是密文是错的，无法校验。总之，您需要找到密文出错的地方并加以修复，然后上述所有问题就迎刃而解了。`}</p>
    <h2 {...{
      "id": "检查您自己的-ssl-证书是否存在问题"
    }}>{`检查您自己的 SSL 证书是否存在问题`}</h2>
    <p>{`您的证书将直接应用于`}<inlineCode parentName="p">{`cattle-system`}</inlineCode>{`命名空间中的 Ingress 对象。`}</p>
    <p>{`检查 Ingress 对象的状态，并查看其是否准备就绪。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n cattle-system describe ingress
`}</code></pre>
    <p>{`如果其就绪但 SSL 仍无法正常工作，则您的证书或密文的格式可能有问题。`}</p>
    <p>{`检查 nginx-ingress-controller 日志。由于 nginx-ingress-controller 的 Pod 中有多个容器，因此您需要指定容器的名称。`}</p>
    <pre><code parentName="pre" {...{}}>{`kubectl -n ingress-nginx logs -f nginx-ingress-controller-rfjrq nginx-ingress-controller
...
W0705 23:04:58.240571       7 backend_ssl.go:49] error obtaining PEM from secret cattle-system/tls-rancher-ingress: error retrieving secret cattle-system/tls-rancher-ingress: secret cattle-system/tls-rancher-ingress was not found
`}</code></pre>
    <h2 {...{
      "id": "没有匹配的-issuer"
    }}>{`没有匹配的 “Issuer”`}</h2>
    <p>{`如果您选择的 `}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/k8s-install/helm-rancher/_index"
      }}>{`SSL 配置`}</a>{`选项需要 cert-manager，则您需要在安装 Rancher 之前安装 `}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/k8s-install/helm-rancher/_index"
      }}>{`cert-manager`}</a>{`，否则将显示以下错误：`}</p>
    <pre><code parentName="pre" {...{}}>{`Error: validation failed: unable to recognize "": no matches for kind "Issuer" in version "certmanager.k8s.io/v1alpha1"
`}</code></pre>
    <p>{`请先安装 `}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/k8s-install/helm-rancher/_index"
      }}>{`cert-manager`}</a>{`， 然后再次尝试安装 Rancher。`}</p>
    <h2 {...{
      "id": "canal-pod-显示-ready-23"
    }}>{`Canal Pod 显示 READY 2/3`}</h2>
    <p>{`此问题的最常见原因是节点之间的 8472 / UDP 端口没有打开。检查您的本地防火墙，网络路由或安全组。`}</p>
    <p>{`解决网络问题后，待`}<inlineCode parentName="p">{`canal`}</inlineCode>{` Pod 超时后，`}<inlineCode parentName="p">{`canal`}</inlineCode>{`会自动重启并建立连接。`}</p>
    <h2 {...{
      "id": "nginx-ingress-controller-pod-显示-restarts"
    }}>{`nginx-ingress-controller Pod 显示 RESTARTS`}</h2>
    <p>{`此问题的最常见原因是`}<inlineCode parentName="p">{`canal`}</inlineCode>{` Pod 未能建立 overlay 网络。有关疑难解答，请参见 `}<a parentName="p" {...{
        "href": "#canal-pod-%E6%98%BE%E7%A4%BA-ready-23"
      }}>{`canal Pods show READY 2/3 `}</a>{`。`}</p>
    <h2 {...{
      "id": "failed-to-dial-to-varrundockersock-ssh-rejected-administratively-prohibited-open-failed"
    }}>{`Failed to dial to /var/run/docker.sock: ssh: rejected: administratively prohibited (open failed)`}</h2>
    <p>{`产生此错误的某些原因包括：`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`指定连接的用户无权访问 Docker 套接字。这可以通过登录主机并运行命令 `}<inlineCode parentName="p">{`docker ps`}</inlineCode>{` 来检查：`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`$ ssh user@server
user@server$ docker ps
CONTAINER ID        IMAGE               COMMAND                  CREATED             STATUS              PORTS                    NAMES
`}</code></pre>
        <p parentName="li">{`请参阅`}<a parentName="p" {...{
            "href": "https://docs.docker.com/install/linux/linux-postinstall/#manage-docker-as-a-non-root-user"
          }}>{`以非 root 用户身份管理 Docker`}</a>{`，了解如何正确地进行设置。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`当使用 RedHat / CentOS 作为操作系统时，由于 `}<a parentName="p" {...{
            "href": "https://bugzilla.redhat.com/show_bug.cgi?id=1527565"
          }}>{`Bugzilla #1527565`}</a>{`，您不能使用`}<inlineCode parentName="p">{`root`}</inlineCode>{`用户连接到节点。您将需要添加一个单独的用户并将其配置为访问 Docker 套接字的用户。请参阅`}<a parentName="p" {...{
            "href": "https://docs.docker.com/install/linux/linux-postinstall/#manage-docker-as-a-non-root-user"
          }}>{`以非 root 用户身份管理 Docker`}</a>{`，了解如何正确地进行设置。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`SSH 服务器版本不是 6.7 或更高版本。这是套接字转发功能所必需的版本要求，套接字转发用于通过 SSH 连接到 Docker 套接字。可以使用要连接的主机上的`}<inlineCode parentName="p">{`sshd -V`}</inlineCode>{`或使用 netcat 来进行检查：`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`$ nc xxx.xxx.xxx.xxx 22
SSH-2.0-OpenSSH_6.6.1p1 Ubuntu-2ubuntu2.10
`}</code></pre>
      </li>
    </ul>
    <h2 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-no-key-found"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: no key found`}</h2>
    <p>{`在`}<inlineCode parentName="p">{`ssh_key_path`}</inlineCode>{`中指定的密钥文件无法访问。确保指定了私钥文件（不是公共密钥`}<inlineCode parentName="p">{`.pub`}</inlineCode>{`），并且运行`}<inlineCode parentName="p">{`rke`}</inlineCode>{`命令的用户可以访问这个密钥文件。`}</p>
    <h2 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-ssh-handshake-failed-ssh-unable-to-authenticate-attempted-methods-none-publickey-no-supported-methods-remain"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: ssh: handshake failed: ssh: unable to authenticate, attempted methods `}{`[none publickey]`}{`, no supported methods remain`}</h2>
    <p>{`在`}<inlineCode parentName="p">{`ssh_key_path`}</inlineCode>{`中指定的密钥文件对于访问该节点无效。仔细检查是否为节点指定了正确的`}<inlineCode parentName="p">{`ssh_key_path`}</inlineCode>{`，以及是否指定了与之连接的正确用户。`}</p>
    <h2 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-cannot-decode-encrypted-private-keys"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: cannot decode encrypted private keys`}</h2>
    <p>{`如果要使用加密的密钥，则应使用`}<inlineCode parentName="p">{`ssh-agent`}</inlineCode>{`来用密码加载密钥。如果在运行 `}<inlineCode parentName="p">{`rke`}</inlineCode>{` 命令的环境中有 `}<inlineCode parentName="p">{`SSH_AUTH_SOCK`}</inlineCode>{` 环境变量，在连接节点时将自动使用它。`}</p>
    <h2 {...{
      "id": "cannot-connect-to-the-docker-daemon-at-unixvarrundockersock-is-the-docker-daemon-running"
    }}>{`Cannot connect to the Docker daemon at unix:///var/run/docker.sock. Is the docker daemon running?`}</h2>
    <p>{`无法通过配置的`}<inlineCode parentName="p">{`address`}</inlineCode>{`和`}<inlineCode parentName="p">{`port`}</inlineCode>{`访问该节点。`}</p>
    </MDXLayout>;
}

